//SPDX-License-Identifier: GPL-3.0

pragma solidity >0.8.0;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/access/AccessControl.sol";

contract Crowdfunding {
    mapping(address => uint) public contributers;
    address public admin;

    int public noOfContributors;
    uint public minimumContribution;
    uint public deadline;
    uint public goal;
    uint public raisedAmount;

    struct Request {
        string desrciption;
        address payable recipient;
        int value;
        bool completed;
        int noOfVoters;
        mapping(address => bool) voters;
    }

    // Events
    event ContributeEvent(address _sender, uint _value);
    event CreateRequestEvent(
        string _desrciption,
        address _recipient,
        int _value
    );
    event MakePaymentEvent(address _recipient, int _value);

    // cannot store Request in array as it contains mapping
    // therefore use mapping
    mapping(int => Request) public requests;
    int public numRequests;

    constructor(uint _goal, uint _deadline) {
        goal = _goal;
        deadline = block.timestamp + _deadline;
        minimumContribution = 100 wei;
        admin = msg.sender;
    }

    function contribute() public payable {
        // require(block.timestamp < deadline, "Deadline has passed");
        require(
            msg.value >= minimumContribution,
            "minimum contribution not met"
        );

        if (contributers[msg.sender] == 0) {
            noOfContributors++;
        }
        contributers[msg.sender] += msg.value;
        raisedAmount += msg.value;

        emit ContributeEvent(msg.sender, msg.value);
    }

    receive() external payable {
        contribute();
    }

    function getBalance() public view returns (uint) {
        return address(this).balance; // in wei
    }

    function getRefund() public {
        require(block.timestamp >= deadline && raisedAmount < goal);
        require(contributers[msg.sender] > 0);

        address payable recipient = payable(msg.sender);
        uint value = contributers[msg.sender];
        contributers[msg.sender] = 0;
        recipient.transfer(value);
    }

    modifier onlyAdmin() {
        require(msg.sender == admin, "only admin can call this function");
        _;
    }

    function createRequest(
        string memory _desrciption,
        address payable _recipient,
        int _value
    ) public onlyAdmin {
        Request storage newRequest = requests[numRequests];
        numRequests++;

        newRequest.desrciption = _desrciption;
        newRequest.recipient = _recipient;
        newRequest.value = _value;
        newRequest.completed = false;
        newRequest.noOfVoters = 0;

        emit CreateRequestEvent(_desrciption, _recipient, _value);
    }

    function voteRequest(int _requestNo) public {
        require(
            contributers[msg.sender] > 0,
            "You must be a contributor to vote!"
        );
        Request storage thisRequest = requests[_requestNo];

        require(
            thisRequest.voters[msg.sender] == false,
            "You have already voted"
        );
        require(numRequests >= _requestNo, "Request does not exist.");

        thisRequest.voters[msg.sender] = true;
        thisRequest.noOfVoters++;
    }

    function makePayment(int _requestNo) public onlyAdmin {
        require(raisedAmount >= goal);
        Request storage thisRequest = requests[_requestNo];
        require(
            thisRequest.completed == false,
            "The request has been completed."
        );
        require(thisRequest.noOfVoters > noOfContributors / 2);

        thisRequest.recipient.transfer(uint(thisRequest.value));
        thisRequest.completed = true;

        emit MakePaymentEvent(thisRequest.recipient, thisRequest.value);
    }
}
